    false,nt"url": null,nt"notes": "NCEI Accession 0143945 includes discrete
    sample and profile data collected from Kaiyo in the North Pacific Ocean and Philippine
    Sea from 1994-02-16 to 1994-02-24. These data include BAROMETRIC PRESSURE, DELTA
    CARBON-14, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Potential temperature
    (theta), SALINITY, WATER TEMPERATURE, phosphate and silicate. The instruments used
    to collect these data include CTD and bottle.nnThese data were collected by Kei
    Muneyama of Japan Agency for Marine-Earth Science and Technology (JAMSTEC) as part
    of the GLODAPv2_49XK19940216 data set. CDIAC associated the following cruise ID(s)
